import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 59.1-516 Investigative authority.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-516.md","filePath":"vacode/59.1-516.md"}'),r={name:"vacode/59.1-516.md"},n=i('<h1 id="§-59-1-516-investigative-authority" tabindex="-1">§ 59.1-516 Investigative authority. <a class="header-anchor" href="#§-59-1-516-investigative-authority" aria-label="Permalink to &quot;§ 59.1-516 Investigative authority.&quot;">​</a></h1><p>Whenever the Attorney General has reasonable cause to believe that any person has engaged in, is engaging in, or is about to engage in any violation of this chapter, the Attorney General is empowered to issue a civil investigative demand. The provisions of § <a href="/vacode/59.1-9.10/">59.1-9.10</a> shall apply mutatis mutandis to civil investigative demands issued pursuant to this section.</p><p>2001, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0528" target="_blank" rel="noreferrer">528</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0553" target="_blank" rel="noreferrer">553</a>; 2019, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0256" target="_blank" rel="noreferrer">256</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?191+ful+CHAP0264" target="_blank" rel="noreferrer">264</a>.</p>',3),o=[n];function s(l,c,h,g,v,_){return t(),a("div",null,o)}const f=e(r,[["render",s]]);export{d as __pageData,f as default};
